import React, { useState } from 'react';
import DoctorProfile from './DoctorProfile';  // Import the DoctorProfile component
import './Doctordashboard.css'
const Doctordashboard = () => {
  // State to toggle visibility of DoctorProfile
  const [isProfileFormVisible, setIsProfileFormVisible] = useState(false);

  const handleCreateProfile = () => {
    setIsProfileFormVisible(true);  // Show the DoctorProfile form
  };

  return (
    <div className="doctor-dashboard">
      <div className="sidebar">
        <ul>
          <li>
            <button onClick={handleCreateProfile}>Create Profile</button>
          </li>
          {/* Add more sidebar options here */}
        </ul>
      </div>

      <div className="content">
        <h2>Welcome to your Dashboard</h2>
        
        {/* Conditionally render DoctorProfile form */}
        {isProfileFormVisible && <DoctorProfile />}
        
        {/* Add other content for the dashboard */}
      </div>
    </div>
  );
};

export default Doctordashboard;
